ReactDOM.render(Book,document.getElementById('root'));

const Book = 
  <Fragment>
    {books.map (book => {
      let {id, volumeInfo: {title, authors, description, imageLinks: {thumbnail}}} = book;
    return (
      <div className='bookContainer'>
      <p>{id}</p>
      <img src= {thumbnail} alt = {title}></img>
      <p>{title}</p>
      <p>{authors}</p>
      <p>{description}</p>
    </div>
      )
})};
  </Fragment>;

export default Book
